import React from 'react'
import axios from 'axios';
function Test() {

    function get(){
        axios.get("http://localhost:5000/")
    .then((res)=>{
        console.log(res.data);
    })
    .catch((err)=>{
        console.log(err);

    })
    }


  return (
    <div>Test</div>
  )
}

export default Test
